import Vue from 'vue';
import App from './App.vue';
import VueResource from 'vue-resource';
import VueRouter from 'vue-router';
import Officers from './components/Officers';
import JobOrder from './components/JobOrder';
import Home from './components/Home';
import SignUp from './components/SignUp';
import EmailConfirmed from './components/EmailConfirmed';
import InvalidEmail from './components/InvalidEmail.vue';
import EmailAlready from './components/EmailAlreadyExists.vue';
import ArticleDescrip from './components/ArticleDescrip.vue';

Vue.use(VueResource);
Vue.config.productionTip = false;

Vue.use(VueRouter);
const routes = [
    {path:'/aboutus', component: Officers},
    {path: '/', component: Home},
    {path: '/contact', component: JobOrder},
    {path: '/signup', component: SignUp},
    {path: '/email_confirmed', component: EmailConfirmed},
    {path: '/invalid_email', component: InvalidEmail},
    {path: '/email_exists_already', component: EmailAlready},
    {path: '/article/:token1/:token2/:token3', name: "article", component: ArticleDescrip},
]

const router = new VueRouter({
    routes
})
new Vue({
  router,
  render: h => h(App)
}).$mount('#app');
